import React, {useState} from "react";
import "./App.css";

function Creatediv({width,height}){
 return <div style={{ width:width+"px" , height:height+"px",backgroundColor:"red" }}> A </div>
}

function App(){  
  const [width,setWidth] = useState(20)
  const [height,setHeight] = useState(20)

  const chnageWidth =(e)=>{
    setWidth(e.target.value)
  }
  const chnageHeight=(e)=>{
    setHeight(e.target.value)
  }
    return (
    <div className="App"> 
      <Creatediv width={width} height={height}/>
      Width : <input type="number" onChange={chnageWidth} /><br/>
      Height : <input type="number" />
    </div>
  )
}

export default App;
